import React from "react";
import { QueryClient, QueryClientProvider } from "react-query";
import { MainPage } from './pages';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { useLocalStorage } from "./hooks";
import initI18n from 'src/config/i18n';

const App = () => {
  initI18n();
  const [valueStored, setStoreValues] = useLocalStorage({
    key: "clients",
    initialValue: [],
  });

  const queryClient = new QueryClient();

  return (
    <QueryClientProvider client={queryClient}>
      <Router>
        <Switch>
          <Route path="/revisited">
            <MainPage
              propClients={valueStored}
              setStoreValues={setStoreValues}
            />
          </Route>
          <Route path="/">
            <MainPage propClients={[]} setStoreValues={setStoreValues} />
          </Route>
        </Switch>
      </Router>
    </QueryClientProvider>
  );
};

export default App;
